import React, { useEffect, useState } from 'react';
import { fetchImageList } from '../utils/imageFetcher';

const Latest_image = () => {
  const [images, setImages] = useState([]);

  useEffect(() => {
    fetchImageList().then(setImages);
  }, []);

  return (
    <div className="p-6 max-w-screen-xl mx-auto">
      <h1 className="text-2xl font-bold mb-6">전체 저장된 이미지 목록</h1>
      <div className="grid grid-cols-3 gap-6">
        {images.map((url, idx) => (
          <div key={idx} className="border p-2 flex items-center justify-center">
            <img src={url} alt={`img-${idx}`} className="h-48 object-contain" />
          </div>
        ))}
      </div>
    </div>
  );
};

export default Latest_image;
